// ==UserScript==
// @name         AB Vector Logo
// @namespace    TheFallingMan
// @version      0.2.1
// @description  Replaces the low resolution logo and icon.
// @author       TheFallingMan
// @icon         https://animebytes.tv/favicon.ico
// @match        https://animebytes.tv/*
// @license      GPL-3.0
// ==/UserScript==

(function() {
    function insertCSS(text) {
        var style = document.createElement('style');
        style.appendChild(document.createTextNode(text));
        document.head.appendChild(style);
    }

    var favicon = "data:image/x-icon;base64,";

    var faviconRed = 'data:image/x-icon;base64,';

    var faviconOld = 'data:image/x-icon;base64,';

    var css = `
    #logo>a {
        background: none;
        font-family: 'Century Gothic', sans-serif;
        font-weight: bold;
        color: #f6f6f7;
        font-size: 1.4em;
        letter-spacing: -0.2pt;
    }

    #logo>a:hover {
        background: none;
        color: #989ba0;
    }
    `;
    insertCSS(css);

    var logo = document.querySelector('#logo a');
    logo.textContent = 'animebytes';

    window.addEventListener('load', function() {
        var iconLink = document.querySelector('link[rel="shortcut icon"]');
        iconLink = document.createElement('link');
        iconLink.rel = 'icon';
        iconLink.type = 'image/x-icon';
        iconLink.href = faviconRed;
        document.head.appendChild(iconLink);
    });
})();